import React from "react";
import {
  MDBRow,
  MDBCol,
  MDBCard,
  MDBCardBody,
  MDBIcon,
  MDBBtn,
} from "mdbreact";

const OurPrice = () => {
  return (
    <div>
      <div class="  col-lg-4 col-md-12 mb-4">
        <div class="  pricing-card">
          <div class="price  header1 white-text blue rounded-top">
            <h2 class="number">10</h2>
            <div class="version">
              <h5 class="mb-0">Basic</h5>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default OurPrice;
